import React from 'react';
import "./input.scss";

const Input = (props) => {

    let inputElement = null;

    switch (props.elementType) {
        case ('input'):
            inputElement = <input 
                className="input"
                {...props.elementConfig}
                value={props.value}
                onChange={props.changed} />;
            break;

        case ('input-v1'):
            inputElement = <input 
                className="input-v1"
                {...props.elementConfig}
                value={props.value}
                onChange={props.changed} />;
            break;
        
        default:
            inputElement = <input 
                className="input"
                {...props.elementConfig}
                value={props.value}
                onChange={props.changed} />;
    }

    return (
        <div>
            {inputElement}
        </div>
    );
}

export default Input;
